import style from './Landing.module.css';
import { FaUser } from 'react-icons/fa';


const Landing = () => {
    return (
        <div className={style.mainContainer}>
            <div className={style.start}>
                <h1>Dog Breeds</h1>
                <hr />
                <button>START</button>
                <div>
                    <FaUser />
                </div> 
            </div>
        </div>
    )
}


export default Landing;
